INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 1, 100, "2024/10/31 12:00:00", 3001, 0.0, 3001100, 2.1, 130011, -416.5, 2, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 4, 101, "2024/10/31 12:00:00", 3001, 0.0, 3001101, 5.68, 130011, -416.5, 2, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 1, 102, "2024/10/31 12:00:00", 3001, 0.0, 3001102, 0.0, 130011, -416.5, 1, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 1, 100, "2024/10/31 12:00:00", 3002, 0.0, 3002100, 0.0, 130211, -416.5, 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 1, 101, "2024/10/31 12:00:00", 3002, 0.0, 3002101, 0.0, 130211, -416.5, 1, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 5, 102, "2024/10/31 12:00:00", 3002, 0.0, 3002102, 8.53, 130211, -416.5, 2, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 7, 103, "2024/10/31 12:00:00", 3002, 0.0, 3002103, 5.67, 130211, -416.5, 1, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 1, 104, "2024/10/31 12:00:00", 3002, 0.0, 3002104, 0.0, 130211, -416.5, 1, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 3, 300, "2024/10/31 12:00:00", 3004, 0.0, 3002300, 0.0, 130211, -416.5, 3, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 7, 301, "2024/10/31 12:00:00", 3005, 0.0, 3002400, 0.0, 130211, -416.5, 7, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 2, 200, "2024/10/31 12:00:00", 3003, 0.0, 3003200, 4.4, 130211, -416.5, 1, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 7, 201, "2024/10/31 12:00:00", 3003, 0.0, 3003201, 0.0, 130211, -416.5, 7, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "フブキ");
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2030/01/01 14:59:59", 1, 202, "2024/10/31 12:00:00", 3003, 0.0, 3003202, 5.6, 130211, -416.5, 2, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "フブキ");
